import React from "react";
function Social(){
    return(
<ul className="list-group">
                <li className="list-group-ti">
                    <input type="checkbox" id="facebook"/>
                    <label htmlFor="facebook">facebook</label>
                </li>
                <li>youtube</li>
                <li>instagram</li>
            </ul>

    );
}
export default Social;
